import React from "react";

export default function Gallery({ rects, handleRemoveRect }) {
  return (
    <div>
      <h1>Galeria</h1>
      {rects}
      {rects && (
        <ul>
          {rects.map((rect, id) => {
            console.log(
              "x",
              typeof rects,
              rects.split(","),
              rects.split(",").length
            );
            return (
              <div key={id}>
                <li>
                  <div
                    className="output-rect"
                    style={{
                      backgroundColor: rect.backgroundColor,
                      width: `${rect.width}px`,
                      height: `${rect.height}px`,
                      borderRadius: `${rect.borderRadius}px`,
                    }}
                  ></div>
                </li>
                <button onClick={handleRemoveRect(id)}>Remove</button>
              </div>
            );
          })}
        </ul>
      )}
    </div>
  );
}
